import React from "react";
import Header from "../layout/Header";
import Contents from "../layout/Contents";
import Footer from "../layout/Footer";
import Title from "../layout/Title";
import Contact from "../layout/Contact";
import UnsplashCont from "../includes/UnsplashCont";
import { createApi } from "unsplash-js";
import nodeFetch from "node-fetch";

const unsplash = createApi({
  accessKey: "tAVffcr0OH82NIrhxNxzcvTr9SQC8WqhRAP8aI5R2XY",
});

// non-feed example
unsplash.photos.get({ photoId: "foo" }).then((result) => {
  if (result.errors) {
    // handle error here
    console.log("error occurred: ", result.errors[0]);
  } else {
    // handle success here
    const photo = result.response;
    console.log(photo);
  }
});

// feed example
unsplash.users.getPhotos({ username: "foo" }).then((result) => {
  if (result.errors) {
    // handle error here
    console.log("error occurred: ", result.errors[0]);
  } else {
    const feed = result.response;

    // extract total and results array from response
    const { total, results } = feed;

    // handle success here
    console.log(`received ${results.length} photos out of ${total}`);
    console.log("first photo: ", results[0]);
  }
});

function Unsplash() {
  return (
    <>
      <Header />
      <Contents>
        <Title title={["Unslpash", "Api"]} />
        <UnsplashCont />
        <Contact />
      </Contents>
      <Footer />
    </>
  );
}

export default Unsplash;
